// ==UserScript==
// @name Helianthus.annuus
// @namespace http://code.google.com/p/helianthus-annuus/
// @description by 向日
// @version 3.10.3.5850
// @build-time 2013-09-01 04:05:37
// @include http://*.hkgolden.com/*
// @run-at document-start
// @grant none
// ==/UserScript==

(function(encoded)
{
	var
	script = document.createElement('script');

	script.id = 'annuus-script-v3';
	script.appendChild(document.createTextNode(atob(encoded)));

	(function append()
	{
		document.documentElement ? document.documentElement.appendChild(script) : setTimeout(append, 50);
	})();
})('');

